document.addEventListener("keydown", function(e) {
	// console.log(e.keyCode)
	if(!glob_is_input_focused)
	{
		if(e.keyCode == 49)
		{
			krittengine.end_fullscreen();
			//krittengine.set_active_scene('custom')
		} else if(e.keyCode == 50) {
			krittengine.set_active_scene('custom1')
		} else if(e.keyCode == 51) {
			krittengine.set_active_scene('custom2')
		} else if(e.keyCode == 34) {
			krittengine.next_scene()
		} else if(e.keyCode == 33) {
			krittengine.prev_scene()
		}
	}
});

